import React,{ Component } from "react"
import { Navbar, Nav } from 'react-bootstrap';
import {Switch, Route, Link } from 'react-router-dom';
import home from "./home";
import DeviceHome from "./DeviceHome";

class DashBoard extends Component{
    render(){
        return(
            <div>
                <div>
                    <Navbar bg="light" expand="lg">
                        <Navbar.Brand href="/">Smart Grid System</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                                {/* <Nav.Link href="/home">Grid Navigation</Nav.Link>
                                <Nav.Link href="/enegrybalance">Device Details</Nav.Link> */}
                                <ul className="navbar-nav mr-auto">
                                    <li><Link to={'/home'} className="nav-link"> Grid Navigation </Link></li>
                                    <li><Link to={'/device_details'} className="nav-link">Device Details</Link></li>
                                </ul>
                            </Nav>
                            <Switch>
                                <Route exact path='/home' component={home} />
                                <Route exact path ='/device_details' component={DeviceHome}/>
                            </Switch>
                        </Navbar.Collapse>
                    </Navbar>
                </div>
            </div>
        )
    }
}

export default DashBoard;
